import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import ImageGallery from 'react-image-gallery';

export default class ImageWindow extends React.Component{
    constructor(props){
        this.images = props.images;
    }
    render(){
        return(
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <ImageGallery items={this.images}></ImageGallery>
                    {/* <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main' }} position='relative'>
                    </Box> */}
                </Grid>
                <Grid item xs={6}>
                    <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main'}} position='relative'></Box>
                </Grid>
            </Grid>
        )
    }
}
